import React, { useRef } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTimes, faClock } from '@fortawesome/free-solid-svg-icons';

const SettingsMenu = ({
  isVisible,
  onClose,
  pomodoroTime,
  setPomodoroTime,
  shortBreakTime,
  setShortBreakTime,
  longBreakTime,
  setLongBreakTime,
  autoStartBreaks,
  setAutoStartBreaks,
  autoStartPomodoros,
  setAutoStartPomodoros,
}) => {
  const menuRef = useRef();

  if (!isVisible) return null;

  const handleSettingChange = (setter) => (e) => {
    setter(e.target.value);
  };

  const handleClickOutside = (event) => {
    if (menuRef.current && !menuRef.current.contains(event.target)) {
      onClose();
    }
  };

  return (
    <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50 z-30" onClick={handleClickOutside}>
      <div ref={menuRef} className="bg-white rounded-lg shadow-lg w-96 p-6 relative">
        <button onClick={onClose} className="absolute top-2 right-2 text-gray-600 hover:text-gray-900">
          <FontAwesomeIcon icon={faTimes} />
        </button>
        <h3 className="text-xl font-bold mb-4 flex items-center">
          <FontAwesomeIcon icon={faClock} className="mr-2" /> Timer
        </h3>
        <div className="mb-4">
          <label className="block mb-2 font-semibold">Pomodoro Time:</label>
          <input
            type="number"
            value={pomodoroTime}
            onChange={handleSettingChange(setPomodoroTime)}
            className="block w-full p-2 border rounded"
          />
        </div>
        <div className="mb-4">
          <label className="block mb-2 font-semibold">Short Break Time:</label>
          <input
            type="number"
            value={shortBreakTime}
            onChange={handleSettingChange(setShortBreakTime)}
            className="block w-full p-2 border rounded"
          />
        </div>
        <div className="mb-4">
          <label className="block mb-2 font-semibold">Long Break Time:</label>
          <input
            type="number"
            value={longBreakTime}
            onChange={handleSettingChange(setLongBreakTime)}
            className="block w-full p-2 border rounded"
          />
        </div>
        <div className="mb-4 flex items-center">
          <label className="mr-2 font-semibold">Auto Start Breaks:</label>
          <div className="relative inline-block w-10 mr-2 align-middle select-none">
            <input
              type="checkbox"
              name="autoStartBreaks"
              id="autoStartBreaks"
              checked={autoStartBreaks}
              onChange={() => setAutoStartBreaks(!autoStartBreaks)}
              className="toggle-checkbox absolute block w-6 h-6 rounded-full bg-white border-4 appearance-none cursor-pointer"
            />
            <label
              htmlFor="autoStartBreaks"
              className="toggle-label block overflow-hidden h-6 rounded-full bg-gray-300 cursor-pointer"
            ></label>
          </div>
        </div>
        <div className="mb-4 flex items-center">
          <label className="mr-2 font-semibold">Auto Start Pomodoros:</label>
          <div className="relative inline-block w-10 mr-2 align-middle select-none">
            <input
              type="checkbox"
              name="autoStartPomodoros"
              id="autoStartPomodoros"
              checked={autoStartPomodoros}
              onChange={() => setAutoStartPomodoros(!autoStartPomodoros)}
              className="toggle-checkbox absolute block w-6 h-6 rounded-full bg-white border-4 appearance-none cursor-pointer"
            />
            <label
              htmlFor="autoStartPomodoros"
              className="toggle-label block overflow-hidden h-6 rounded-full bg-gray-300 cursor-pointer"
            ></label>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SettingsMenu;
